import { Link } from 'react-router-dom';
import { useState, useEffect } from 'react';

const Patinage = () => {
    const [data,setData]=useState([]);
    const getData=()=>{
        fetch('./db.json'
        ,{
        headers : { 
            'Content-Type': 'application/json',
            'Accept': 'application/json'
        }
        }
        )
        .then(function(response){
            console.log(response)
            return response.json();
        })
        .then(function(myJson) {
            console.log(myJson);
            setData(myJson)
        });
    }

    useEffect(()=>{
        getData()
    },[])





    return (
        <div className="Patinage">
            <div className="Front-Panel">
                <h1>Patinage</h1>
                <h3>Filtres</h3>
                <div className="filtres">
                    <form action="/patinage">
                        <div className="filtre">
                            <label for="avant">Patinage avant</label>
                            <input type="checkbox" id="avant" name="avant" value="avant"></input>
                        </div>
                        <div className="filtre">
                            <label for="arriere">Patinage à reculons</label>
                            <input type="checkbox" id="arriere" name="arriere" value="arriere"></input>
                        </div>
                        <div className="filtre">
                            <label for="vitesse">Vitesse</label>
                            <input type="checkbox" id="vitesse" name="vitesse" value="vitesse"></input>
                        </div>
                        <div className="filtre">
                            <label for="agilite">Agilité</label>
                            <input type="checkbox" id="agilite" name="agilite" value="agilite"></input>
                        </div>

                        <input type="submit" value="Filtrer" />
                    </form>
                </div>

                <div className="videos">
                    <div className='row'>
                        <div className="single-video-display">
                            <img src="https://i3.ytimg.com/vi/C6SEwTyJtpE/maxresdefault.jpg" alt="Patinage avant" />
                            <Link
                                to={{
                                    pathname: "/video",
                                    state:{
                                        myUrl: "https://www.youtube.com/watch?v=C6SEwTyJtpE&t=1s",
                                    },
                                }}>Améliorer son patinage avant</Link>
                        </div>
                        <div className="single-video-display">
                            <img src="https://i3.ytimg.com/vi/dXqep-ixfDE/maxresdefault.jpg" alt="Patiner sans patins" />
                            <Link
                                to={{
                                    pathname: "/video",
                                    state:{
                                        myUrl: "https://www.youtube.com/watch?v=dXqep-ixfDE",
                                    },
                                }}>Patiner sans patins</Link>
                        </div>
                        <div className="single-video-display">
                            <img src="https://i3.ytimg.com/vi/VT5OZe07N9U/maxresdefault.jpg" alt="Posture" />
                            <Link>Travailler la posture</Link>
                        </div>
                    </div>
                    <div className='row'>
                        <div className="single-video-display">
                            <img src="https://i3.ytimg.com/vi/rUqCrc4tUhM/maxresdefault.jpg" alt="Rester bas" />
                            <Link>L'importance de rester bas</Link>
                        </div>
                        <div className="single-video-display">
                            <img src="https://i3.ytimg.com/vi/q8-aoYR-bYo/maxresdefault.jpg" alt="Edges" />
                            <Link>Les carrés de lame (edges)</Link>
                        </div>
                        <div className="single-video-display">
                            <img src="https://i3.ytimg.com/vi/vuaIJq5YKKA/maxresdefault.jpg" alt="Agilité et équilibre" />
                            <Link>Agilité et équilibre</Link>
                        </div>
                    </div>
                    
                    
                </div>

                <div className="pages">
                    <h3>Vidéos:</h3>
                    {
                        data && data.length>0 && data.map((item)=><p>{item.about}</p>)
                    }              
                </div>
            </div>
        </div>
    );
}
 
export default Patinage;
